/*Table structure for table `cp_order` */

DROP TABLE IF EXISTS `cp_order`;

CREATE TABLE `cp_order` (
  `ID` int(32) NOT NULL auto_increment COMMENT '流水号',
  `CFG_ID` varchar(512) default NULL COMMENT '配置ID,关联彩票配置表',
  `XZDH` varchar(128) NOT NULL default '' COMMENT '下注单号',
  `XZSJ` datetime NOT NULL COMMENT '下注时间',
  `QS` varchar(32) NOT NULL COMMENT '期数',
  `GAME_TYPE_CODE` varchar(32) NOT NULL COMMENT '游戏类型代码',
  `GAME_TYPE_NAME` varchar(32) NOT NULL COMMENT '游戏类型名称',
  `CP_TYPE_CODE` varchar(32) NOT NULL COMMENT '彩票类型代码',
  `CP_TYPE_NAME` varchar(32) NOT NULL COMMENT '彩票类型名称',
  `CP_CATE_CODE` varchar(32) NOT NULL COMMENT '彩票类别代码',
  `CP_CATE_NAME` varchar(128) NOT NULL COMMENT '彩票类别名称',
  `XZLX_CODE` varchar(32) default NULL COMMENT '下注类型代码',
  `XZLX_NAME` varchar(128) default NULL COMMENT '下注类型名称',
  `XZZU_CODE` varchar(32) default NULL COMMENT '下注组别代码',
  `XZZU_NAME` varchar(128) default NULL COMMENT '下注组别名称',
  `NUMBER` varchar(512) NOT NULL COMMENT '号码',
  `PL` varchar(32) NOT NULL COMMENT '赔率',
  `XZJE` double NOT NULL COMMENT '下注金额',
  `YJ` double default '0' COMMENT '佣金',
  `KYJE` double default NULL COMMENT '可赢金额',
  `ZGJE` double default NULL COMMENT '总共金额',
  `HYSF` double default NULL COMMENT '会员收付',
  `YXTZ` double default NULL COMMENT '有效投注。和局为0，反为下注金额',
  `KJJG` varchar(64) default NULL COMMENT '开奖结果',
  `OPEN_TIME` datetime default NULL COMMENT '开奖时间',
  `SFJS` varchar(10) NOT NULL default '' COMMENT '是否结算(0未结算,1 已结算,2 已取消)',
  `CONTENT` varchar(512) default NULL COMMENT '内容',
  `BZ` varchar(512) default NULL COMMENT '备注',
  `USER_IP` varchar(32) default NULL COMMENT '用户IP',
  `USER_NAME` varchar(32) NOT NULL COMMENT '创建人ID',
  `CREATE_TIME` datetime default NULL COMMENT '创建时间',
  `MODIFY_TIME` datetime default NULL COMMENT '修改时间',
  `ORDER_STATUS` varchar(32) default NULL COMMENT '订单状态 输、赢、和 、取消',
  `BACK_WATER_RATE` double default NULL COMMENT '返水比例',
  `BACK_WATER_STATUS` int(11) default '0' COMMENT '返水（0未返水，1已返水）',
  `BACK_WATER_TIME` datetime default NULL COMMENT '返水时间',
  `BACK_WATER_MONEY` double default NULL COMMENT '返水金额',
  `USER_AGENT` varchar(64) default NULL COMMENT '所属代理',
  `IS_SYNC` int(11) default NULL COMMENT '是否同步0否1是',
  `WIN_MONEY` double default NULL COMMENT '中奖金额',
  `BET_USR_WIN` double default NULL COMMENT '用户赢的金额=中奖金额+返水金额-投注总额',
  `auto_update_time` datetime default NULL,
  `WEB_FLAG` varchar(50) default NULL COMMENT '网站标识',
  PRIMARY KEY  (`ID`),
  UNIQUE KEY `XZDH` (`XZDH`)
) ENGINE=InnoDB AUTO_INCREMENT=195107 DEFAULT CHARSET=utf8;

