/*Table structure for table `t_activity_info` */

DROP TABLE IF EXISTS `t_activity_info`;

CREATE TABLE `t_activity_info` (
  `id` int(11) NOT NULL auto_increment COMMENT '流水号',
  `activity_name` varchar(128) default NULL COMMENT '活动名称',
  `begin_time` datetime NOT NULL COMMENT '活动开始时间',
  `end_time` datetime NOT NULL COMMENT '活动结束时间',
  `init_nums` int(11) default NULL COMMENT '初始用户数',
  `growth_rate` double default NULL COMMENT '用户增长率',
  `status` int(11) default NULL COMMENT '活动状态0表示下线1表示上线',
  `message_url` varchar(256) default NULL COMMENT '客服地址',
  `lott_condition` text COMMENT '抽奖条件说明',
  `lott_rule` text COMMENT '抽奖规则说明',
  `logo_images` varchar(256) default NULL COMMENT 'logon图片',
  `page_bg_images` varchar(256) default NULL COMMENT '页面背景图片',
  `roulette_images` varchar(256) default NULL COMMENT '大转盘图片',
  `web_url` varchar(256) default NULL COMMENT '网站首页地址',
  `prize_nums` int(11) default NULL COMMENT '奖品数量。要跟奖品表中的数量一致',
  `create_time` datetime default NULL COMMENT '创建时间',
  `modify_time` datetime default NULL COMMENT '修改时间',
  `max_sum_times` int(11) default NULL COMMENT '结算抽奖次数时，最高累计次数',
  `is_dai_rule` int(11) default NULL COMMENT '结算规则；0表示按存款或有效投注量  1表示有效投注量 2表示存款',
  `auto_update_time` datetime default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

