insert  into `t_activity_info`(`id`,`activity_name`,`begin_time`,`end_time`,`init_nums`,`growth_rate`,`status`,`message_url`,`lott_condition`,`lott_rule`,`logo_images`,`page_bg_images`,`roulette_images`,`web_url`,`prize_nums`,`create_time`,`modify_time`,`max_sum_times`,`is_dai_rule`,`auto_update_time`) values (1,'抽奖大转盘','2015-10-01 19:56:02','2016-04-12 19:56:12',10,20,1,'http://messenger.providesupport.com/messenger/0d5b9i409sspo1is6icgy2ekvb.html',' <p>当日有效投注额达到3000或以上可抽奖1次</p><p>当日有效投注额达到30000或以上可抽奖2次</p><p>抽奖前请仔细阅读”抽奖规则“</p>',' <p>1、会员当日有效投注额达到3000或以上可抽奖1次，当日有效投注额达到30000或以上可抽奖2次；</p><p>2、当日的有效投注额计算周期采用美东时间进行计算，即北京时间每天中午12点至隔天中午12点；</p><p>3、如果您的当日有效投注额达到抽奖条件，即可在隔天（第二天的北京时间中午13:00）后开始抽奖，且需在当天完成抽奖，或则视为放弃活动资格；</p><p>4、除现金筹码以外奖品，从中奖之日起，一个星期未进行申请，将视为自动放弃中奖资格，逾期将无法申请；</p><p>5、如果会员投注于体育赛事于当天未进行结算，有效投注额将在隔天进行计算，对此有异议将以系统数据为准；</p><p>6、每位会员每个IP当日累计抽奖次数最多为2次，如发现会员同一个IP下注册多个账号进行投注抽奖，公司有权拒绝赠送其彩金并做账号冻结处理，保证正常玩家的利益；</p><p>7、获得“iphone6 16G”的会员，请第一时间联系在线客服并提供您的收货地址；</p><p>8、获得“白金会员”和“存送100%优惠券”的会员，请凭您的会员账号联系在线客服申请；</p><p>9、获得“存送100%优惠券”需（本金+彩金）的3倍流水才能出款；</p><p>10、获得“现金筹码”的会员无需申请，系统将在30分钟内自动添加到您的会员账户内，请耐心等待；</p><p>11、此转盘活动为【XX国际】系统程序自动运行，获奖的概率完全遵循力学及自然概率，不涉及任何人工操作，抽奖结果以系统判定为准，不得争议。</p><p style=\"COLOR: #ffd400; FONT-SIZE: 16px; FONT-WEIGHT: bold\">活动声明：</p><p>1、所有红利为随机派送, 如系统发生一些不可预测超出本站控制之外的技术错误, 或人为不可控制的因素, 则XX国际保留最终处理权；</p><p>2、无风险投注包括在百家乐同时投注庄家、闲家；轮盘同时投注黑色、红色，单、双， 大、小；在运动博弈中，对冲或打对，有以上行为均不给予优惠； </p><p>3、玩家不可以使用多账户参加本次活动，凡同一IP地址、同一姓名、同一银行账户，同一联系方式，同一邮箱、同一电脑均视为同一账户，“XX国际”在会员重复申请会员账号时，保留取消、收回会员相关优惠 ；</p><p>4、无论是个人或团体，如有任何威胁、滥用或使用不诚实方式套利的行为，经“XX国际”风险部门审核，公司有权取消该会员所有优惠；</p><p>5、本活动最终解释权归属“XX国际”所有，并保留修改以上条款的最终权利。</p>','/resources-1.0/commons/activity/images/logo.png','/resources-1.0/commons/activity/images/zpbg.jpg','/resources-1.0/commons/activity/images/bg.png','http://www.vns77788.cc',10,NULL,'2015-10-31 08:23:20',999,2,'2016-05-17 15:59:30');

