/*Table structure for table `t_bet_record_ttg_tmp` */

DROP TABLE IF EXISTS `t_bet_record_ttg_tmp`;

CREATE TABLE `t_bet_record_ttg_tmp` (
  `id` int(11) NOT NULL auto_increment COMMENT '数据库主键',
  `web_flag` varchar(10) default NULL COMMENT '网站数据标识',
  `web_remark` varchar(50) default NULL COMMENT '备注',
  `bet_user_name` varchar(50) default NULL COMMENT '会员帐号',
  `bet_flat_account` varchar(50) default NULL COMMENT '游戏平台帐号',
  `bet_game_content` varchar(50) default NULL COMMENT '游戏内容',
  `bet_game_result` varchar(50) default NULL COMMENT '游戏结果',
  `bet_content` varchar(5000) default NULL COMMENT '投注内容',
  `bet_game_hall` varchar(50) default NULL COMMENT '游戏大厅',
  `bet_game_room` varchar(50) default NULL COMMENT '游戏桌号',
  `bet_game_table` varchar(50) default NULL COMMENT '桌号',
  `bet_game_code` varchar(50) default NULL COMMENT '局号（下注的局号）',
  `bet_Wagers_id` varchar(50) default NULL COMMENT '投注单号',
  `bet_in` double default NULL COMMENT '投注的金额',
  `bet_income` double default NULL COMMENT '有效投注的金额',
  `bet_usr_win` double default NULL COMMENT '会员赢的金额（负数）',
  `bet_net_win` double default NULL COMMENT '平台赢的金额（正数）',
  `bet_time` timestamp NULL default NULL COMMENT '投注时间',
  `bet_balance_after` double default NULL COMMENT '下注后的金额',
  `status` int(11) default NULL COMMENT '状态（0下注初始，1已结算）',
  `back_water` varchar(50) default NULL COMMENT '返水比例',
  `back_water_status` int(11) default '0' COMMENT '返水（0未返水，1已返水）',
  `back_water_time` timestamp NULL default NULL COMMENT '返水时间',
  `back_sys_user_name` varchar(50) default NULL COMMENT '返水操作人',
  `create_time` timestamp NULL default NULL COMMENT '创建时间',
  `modify_time` timestamp NULL default NULL COMMENT '修改时间',
  `bet_login_ip` varchar(50) default NULL,
  `bet_user_agent` varchar(50) default NULL,
  `is_water` int(11) default '0' COMMENT '是否需要返水(0:否 1:是)',
  PRIMARY KEY  (`id`),
  UNIQUE KEY `betWagersId` (`bet_Wagers_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

