/*Table structure for table `t_sys_code` */

DROP TABLE IF EXISTS `t_sys_code`;

CREATE TABLE `t_sys_code` (
  `code_type` varchar(50) default NULL COMMENT '字典类型',
  `code_name` varchar(50) default NULL COMMENT '字典名字',
  `code_value` varchar(255) default NULL COMMENT '字典值',
  `code_show_name` varchar(255) default NULL COMMENT '显示名称',
  `code_sort` int(11) default NULL COMMENT '排序',
  `code_status` int(11) default NULL COMMENT '字典状态（0无效，1有效）',
  `code_descript` varchar(255) default NULL COMMENT '描述',
  `auto_update_time` datetime default NULL,
  `id` int(11) NOT NULL auto_increment,
  PRIMARY KEY  (`id`),
  UNIQUE KEY `codekey` (`code_type`,`code_name`)
) ENGINE=InnoDB AUTO_INCREMENT=122 DEFAULT CHARSET=utf8;

