DROP TABLE IF EXISTS `t_sys_max_id`;

CREATE TABLE `t_sys_max_id` (
  `max_id` int(11) NOT NULL auto_increment COMMENT '数据库主键',
  `max_value` int(11) default NULL COMMENT '最大id值',
  `status` int(11) default NULL COMMENT '状态(1有效，0无效)',
  `remark` varchar(255) default NULL COMMENT '备注',
  `modify_time` datetime default NULL COMMENT '修改时间',
  PRIMARY KEY  (`max_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

