/*Table structure for table `t_sys_user_log` */

DROP TABLE IF EXISTS `t_sys_user_log`;

CREATE TABLE `t_sys_user_log` (
  `id` int(11) NOT NULL auto_increment COMMENT '数据库主键',
  `log_user_name` varchar(50) default NULL COMMENT '登录帐号',
  `log_curr_time` timestamp NOT NULL default CURRENT_TIMESTAMP on update CURRENT_TIMESTAMP COMMENT '登录时间',
  `log_curr_ip_add` varchar(50) default NULL COMMENT '登录ip',
  `auto_update_time` datetime default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `t_sys_user_log` */

/*Table structure for table `t_user_pwd_log` */

DROP TABLE IF EXISTS `t_user_pwd_log`;

CREATE TABLE `t_user_pwd_log` (
  `id` int(11) NOT NULL auto_increment COMMENT '流水号',
  `user_name` varchar(64) default NULL COMMENT '用户名',
  `old_password` varchar(64) default NULL COMMENT '旧密码',
  `new_password` varchar(64) default NULL COMMENT '新密码',
  `ip` varchar(128) default NULL COMMENT '用户ip地址',
  `update_time` datetime default NULL COMMENT '更新时间',
  `remark` varchar(256) default NULL COMMENT '备注',
  `auto_update_time` datetime default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=305 DEFAULT CHARSET=utf8;

