/*Table structure for table `t_web_agent` */

DROP TABLE IF EXISTS `t_web_agent`;

CREATE TABLE `t_web_agent` (
  `id` int(11) NOT NULL auto_increment COMMENT '数据库主键',
  `agent_no` varchar(50) default NULL COMMENT '代ID',
  `user_name` varchar(50) default NULL COMMENT '会员编号',
  `user_real_name` varchar(50) default NULL COMMENT '会员姓名',
  `status` int(11) default NULL COMMENT '状态',
  `agent_url` varchar(1024) default NULL COMMENT '推广地址',
  `agent_domain` varchar(50) default NULL COMMENT '推广域名',
  `modify_time` timestamp NULL default NULL,
  `create_time` timestamp NULL default NULL,
  `count` int(11) default NULL COMMENT '会员数',
  `settledTime` timestamp NULL default NULL COMMENT '已结算日期',
  `gmt4_time` timestamp NULL default NULL COMMENT '美东时间',
  `agent_mail` varchar(50) default NULL COMMENT '邮箱',
  `remark` varchar(255) default NULL COMMENT '备注',
  `content` text COMMENT '申请理由',
  `pre_agent_no` varchar(50) default NULL COMMENT '上层代理ID',
  `sys_user_name` varchar(50) default NULL COMMENT '操作者',
  `check_status` int(11) default NULL COMMENT '审核状态',
  `agent_type` int(11) default NULL COMMENT '1退佣类型2退水类型',
  `auto_update_time` datetime default NULL,
  PRIMARY KEY  (`id`),
  UNIQUE KEY `keyAgnetNo` (`agent_no`),
  UNIQUE KEY `keyUserName` (`user_name`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8;

