/*Table structure for table `t_web_carousel` */

DROP TABLE IF EXISTS `t_web_carousel`;

CREATE TABLE `t_web_carousel` (
  `crs_name` varchar(50) NOT NULL COMMENT '名称标识',
  `crs_title` varchar(50) default NULL COMMENT '标题',
  `crs_index` int(11) default NULL COMMENT '权重（越大越靠前）',
  `crs_pic` varchar(255) NOT NULL COMMENT '图片地址',
  `crs_url` varchar(255) default NULL COMMENT '图片链接',
  `crs_content` varchar(255) default NULL COMMENT '图片描述',
  `status` int(11) default '0' COMMENT '关闭0或启动1',
  `create_time` datetime default NULL COMMENT '创建时间',
  `modify_time` datetime default NULL COMMENT '修改时间',
  `sys_user_name` varchar(50) default NULL COMMENT '操作员',
  `crs_time` int(11) default NULL COMMENT '图片轮播时间',
  `crs_type` int(11) default '0' COMMENT '平台标识(0:web 1:wap)',
  `auto_update_time` datetime default NULL,
  PRIMARY KEY  (`crs_name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `t_web_carousel` */

/*Table structure for table `t_web_config` */

DROP TABLE IF EXISTS `t_web_config`;

CREATE TABLE `t_web_config` (
  `id` int(11) NOT NULL auto_increment COMMENT '数据库主键',
  `conf_bank_ratio` double default NULL COMMENT '公司入款优惠比例',
  `conf_bank_dama` double default NULL COMMENT '赠送彩金比例（在线支付、公司入款、后台入款）',
  `conf_bank_dama_mul` double default NULL COMMENT '赠送彩金，要求打码量',
  `conf_withdraw_times` int(11) default NULL COMMENT '免费取款次数',
  `conf_withdraw_ratio` double default NULL COMMENT '取款手续费比例',
  `conf_withdraw_administration` double default NULL COMMENT '取款行政费用',
  `sys_user_name` varchar(50) default NULL,
  `create_time` timestamp NULL default NULL,
  `modify_time` timestamp NULL default NULL,
  `company_min_pay` double default NULL,
  `auto_update_time` datetime default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

/*Data for the table `t_web_config` */

insert  into `t_web_config`(`id`,`conf_bank_ratio`,`conf_bank_dama`,`conf_bank_dama_mul`,`conf_withdraw_times`,`conf_withdraw_ratio`,`conf_withdraw_administration`,`sys_user_name`,`create_time`,`modify_time`,`company_min_pay`,`auto_update_time`) values (1,0.5,0,1,3,50,50,'168',NULL,'2016-09-19 10:25:16',1,'2016-09-19 22:25:16');

/*Table structure for table `t_web_dama` */

DROP TABLE IF EXISTS `t_web_dama`;

CREATE TABLE `t_web_dama` (
  `id` int(11) NOT NULL auto_increment COMMENT '数据库主键',
  `user_name` varchar(50) default NULL COMMENT '帐号',
  `dm_begin_time` timestamp NULL default NULL COMMENT '打码量开始计算时间',
  `dm_multiple` double default NULL COMMENT '打码位数',
  `dm_ori_money` double default NULL COMMENT '初始金额',
  `dm_after_multiple` double default NULL COMMENT '打码量未到，新入款加入打码的倍数',
  `dm_content` text,
  `status` int(11) default NULL COMMENT '0打码量控制失效，1打码量控制有效',
  `sys_user_name` varchar(50) default NULL COMMENT '操作人',
  `create_time` timestamp NULL default NULL,
  `modify_time` timestamp NULL default NULL,
  `remark` varchar(255) default NULL,
  `dm_send_money` double default NULL COMMENT '赠送彩金',
  `dm_ratio` double default NULL COMMENT '优惠比率',
  `dm_req_dm` double default NULL COMMENT '所需的打码量',
  `auto_update_time` datetime default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `t_web_dama` */

/*Table structure for table `t_web_edu` */

DROP TABLE IF EXISTS `t_web_edu`;

CREATE TABLE `t_web_edu` (
  `id` int(11) NOT NULL auto_increment COMMENT '数据库主键',
  `flat_name` varchar(50) default NULL COMMENT '平台标识',
  `edu_order` varchar(50) default NULL COMMENT '订单编号',
  `user_name` varchar(50) NOT NULL COMMENT '会员帐号',
  `edu_points` int(11) default NULL COMMENT '转换金额',
  `edu_type` int(11) default NULL COMMENT '转换类型(2-转入,1-转出)',
  `edu_status` int(11) default NULL COMMENT '转换状态(1-成功,0-失败)',
  `mofidy_time` timestamp NULL default NULL COMMENT '创建时间',
  `create_time` timestamp NULL default NULL COMMENT '创建时间',
  `edu_ip` varchar(50) default NULL COMMENT '用户IP',
  `edu_forward` int(11) default NULL COMMENT '额度转化方向(11BBIN->主帐号,12MG->主帐号,13AG->主帐号,14188体育->主帐号;21主帐号->BBIN，22主帐号->MG,23主帐号->AG,24主帐号->188体育)',
  `edu_forward_remark` varchar(50) default NULL COMMENT '额度转化方向备注',
  `gmt_4_time` timestamp NULL default NULL,
  `auto_update_time` datetime default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=38169 DEFAULT CHARSET=utf8;

/*Data for the table `t_web_edu` */

