/*Table structure for table `t_web_fileinfo` */

DROP TABLE IF EXISTS `t_web_fileinfo`;

CREATE TABLE `t_web_fileinfo` (
  `id` int(11) NOT NULL auto_increment COMMENT '主键id',
  `fileType` varchar(20) default NULL COMMENT '文件类型',
  `fileName` varchar(30) default NULL COMMENT '文件名称',
  `fileUrl` varchar(255) default NULL COMMENT '文件相对路径',
  `filefolder` varchar(20) default NULL COMMENT '存放文件夹名称',
  `uploadTime` timestamp NOT NULL default CURRENT_TIMESTAMP on update CURRENT_TIMESTAMP COMMENT '上传时间',
  `requestIp` varchar(100) default NULL COMMENT '上传网站ip',
  `fileBelong` varchar(20) default NULL COMMENT '文件属于(项目:前端，抽奖等)',
  `auto_update_time` datetime default NULL,
  PRIMARY KEY  (`id`)
