/*Table structure for table `t_web_line_ck` */

DROP TABLE IF EXISTS `t_web_line_ck`;

CREATE TABLE `t_web_line_ck` (
  `id` int(11) NOT NULL COMMENT '数据库主键',
  `lck_logo_pic` varchar(255) default NULL COMMENT '线路检测LOGO地址',
  `lck_logo_width` int(11) default NULL COMMENT 'LOGO宽度',
  `lck_logo_height` int(11) default NULL COMMENT 'LOGO高度',
  `lck_domain` varchar(1024) default NULL COMMENT '域名，以“,”分隔',
  `lck_main_content` text COMMENT '头部内容',
  `lck_foot_content` text COMMENT '底部内容',
  `lck_other_content` text COMMENT '备用字段',
  `lck_main_domain` varchar(255) default NULL COMMENT '主域名',
  `create_time` datetime default NULL,
  `modify_time` datetime default NULL,
  `sys_user_name` varchar(50) default NULL,
  `auto_update_time` datetime default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `t_web_line_ck` */

