/*Table structure for table `t_web_manual_account` */

DROP TABLE IF EXISTS `t_web_manual_account`;

CREATE TABLE `t_web_manual_account` (
  `id` int(11) NOT NULL auto_increment COMMENT '数据库主键',
  `user_name` varchar(50) default NULL COMMENT '会员',
  `ma_class` int(11) default NULL COMMENT '1入款，2出款',
  `ma_type` int(11) default NULL COMMENT '3 红利赠送\\4后台入款\\6免费彩金\\12系统扣款',
  `ma_order` varchar(50) default NULL COMMENT '编号',
  `ma_money` double default NULL COMMENT '金额',
  `remark` varchar(255) default NULL COMMENT '备注',
  `ma_check_sys_user_name` varchar(50) default NULL COMMENT '操作人',
  `ma_check_status` int(11) default NULL COMMENT '操作结果',
  `ma_check_time` timestamp NULL default NULL COMMENT '操作时间',
  `create_time` timestamp NULL default NULL,
  `modify_time` timestamp NULL default NULL,
  `gmt_4_time` timestamp NULL default NULL,
  `auto_update_time` datetime default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=41 DEFAULT CHARSET=utf8;

/*Data for the table `t_web_manual_account` */

insert  into `t_web_manual_account`(`id`,`user_name`,`ma_class`,`ma_type`,`ma_order`,`ma_money`,`remark`,`ma_check_sys_user_name`,`ma_check_status`,`ma_check_time`,`create_time`,`modify_time`,`gmt_4_time`,`auto_update_time`) values (39,'ccww89',1,4,'160920020957085',100,'','168',1,'2016-09-20 02:09:57','2016-09-20 02:09:57','2016-09-20 02:09:57','2016-09-20 02:09:57','2016-09-20 14:09:57'),(40,'ccww89',1,4,'160923034733269',200,'','168',1,'2016-09-23 03:47:33','2016-09-23 03:47:33','2016-09-23 03:47:33','2016-09-23 03:47:33','2016-09-23 15:47:33');

/*Table structure for table `t_web_match_bet` */

DROP TABLE IF EXISTS `t_web_match_bet`;

CREATE TABLE `t_web_match_bet` (
  `id` int(11) NOT NULL auto_increment COMMENT '数据库主健',
  `web_flat` varchar(25) default NULL COMMENT '网站数据标识',
  `web_remark` varchar(50) default NULL COMMENT '网站名称',
  `match_rtype` varchar(25) default NULL COMMENT 'RTYPE',
  `bet_type` int(11) default NULL COMMENT '投注类型（1常规、2滚球）',
  `bet_user_name` varchar(50) default NULL COMMENT '会员帐号',
  `bet_match_content` varchar(255) default NULL COMMENT '投注详细内容',
  `bet_match_result` int(11) default NULL COMMENT '投注结果（输2、赢1）',
  `bet_wagers_id` varchar(50) default NULL COMMENT '投注单号',
  `bet_in` double default NULL COMMENT '投注金额',
  `bet_income` double default NULL COMMENT '有效投注金额',
  `bet_usr_win` double default NULL COMMENT '会员赢的金额（负数）',
  `bet_net_win` double default NULL COMMENT '平台赢的金额（正数）',
  `bet_time` datetime default NULL COMMENT '投注时间',
  `status` int(11) default NULL COMMENT '状态（-2确认注单处理中、待确认订单-1、无效订单0、可结算订单1、已结算订单2、3订单结算过程中）',
  `bet_status` int(11) default NULL,
  `bet_void_reason` varchar(255) default NULL COMMENT '无效原因',
  `time_type` varchar(50) default NULL,
  `bet_sport_type` varchar(50) default NULL COMMENT '体育类型（FT足球、BK篮球）',
  `bet_sport_name` varchar(255) default NULL COMMENT '投注具体类型名称如今日赛-足球-单式',
  `bet_match_ids` varchar(512) default NULL COMMENT '球队IDs,多个用","格开',
  `bet_settled_time` datetime default NULL COMMENT '结算时间',
  `remark` varchar(255) default NULL COMMENT '备注',
  `bet_member_ip_address` varchar(255) default NULL COMMENT '投注IP',
  `order_time` datetime default NULL COMMENT '下注时间（美东时间）',
  `create_time` datetime default NULL,
  `confirm_time` datetime default NULL COMMENT '滚球确定时间（默认比下注时间延迟90秒）',
  `modify_time` datetime default NULL,
  `bet_user_agent` varchar(50) default NULL COMMENT '代理帐号',
  `back_water` varchar(50) default NULL COMMENT '返水比例',
  `back_water_status` int(11) default NULL COMMENT '返水（0未返水，1已返水）',
  `back_water_time` datetime default NULL COMMENT '返水时间',
  `back_sys_user_name` varchar(50) default NULL COMMENT '返水操作人',
  `bet_can_win` double default NULL,
  `auto_update_time` datetime default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `t_web_match_bet` */

/*Table structure for table `t_web_match_detail` */

DROP TABLE IF EXISTS `t_web_match_detail`;

CREATE TABLE `t_web_match_detail` (
  `id` int(11) NOT NULL auto_increment COMMENT '数据库主健',
  `bet_uuid` varchar(50) default NULL COMMENT '唯一索引',
  `bet_wagers_id` varchar(50) default NULL COMMENT '所属投注单[关联bet订单表]',
