/*Table structure for table `t_web_message` */

DROP TABLE IF EXISTS `t_web_message`;

CREATE TABLE `t_web_message` (
  `id` int(11) NOT NULL auto_increment COMMENT '数据库主键',
  `msg_type` int(11) default NULL COMMENT '类型（1系统、2会员、3代理）',
  `msg_title` varchar(255) default NULL COMMENT '消息标题',
  `user_name` varchar(50) default NULL COMMENT '会员',
  `msg_content` text COMMENT '消息内容',
  `msg_status` int(11) default NULL COMMENT '消息状态',
  `manager_user_name` varchar(50) default NULL COMMENT '发送人',
  `create_time` timestamp NULL default NULL COMMENT '创建时间',
  `modify_time` timestamp NULL default NULL COMMENT '修改时间',
  `enable_time` timestamp NULL default NULL COMMENT '有效时间',
  `read_status` int(11) default NULL COMMENT '读的状态',
  `auto_update_time` datetime default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

