/*Table structure for table `t_web_nt_electronic` */

DROP TABLE IF EXISTS `t_web_nt_electronic`;

CREATE TABLE `t_web_nt_electronic` (
  `id` int(11) NOT NULL auto_increment COMMENT '数据库主键',
  `ele_game_code` varchar(50) default NULL COMMENT '游戏CODE',
  `ele_game_enname` varchar(50) default NULL COMMENT '游戏英文名称',
  `ele_game_cnname` varchar(50) default NULL COMMENT '游戏中文名称',
  `ele_game_pic` varchar(255) default NULL COMMENT '游戏图标',
  `ele_game_index` varchar(50) default NULL COMMENT '游戏编号',
  `ele_game_type1` varchar(50) default NULL COMMENT '游戏1级分类',
  `ele_game_type2` varchar(50) default NULL COMMENT '游戏2级分类',
  `remark` varchar(50) default NULL COMMENT '说明',
  `status` int(11) default NULL COMMENT '0:无效 1:有效',
  `ele_sort_index` int(11) default NULL COMMENT '排序索引',
  `ele_hot_num` int(11) default NULL COMMENT '热度',
  `is_water` int(11) default NULL COMMENT '是否需要返水(0:否 1:是)',
  PRIMARY KEY  (`id`)
