/*Table structure for table `t_web_online_huikuan` */

DROP TABLE IF EXISTS `t_web_online_huikuan`;

CREATE TABLE `t_web_online_huikuan` (
  `id` int(11) NOT NULL auto_increment COMMENT '数据库主键',
  `hk_order` varchar(50) default NULL COMMENT '汇款订单号',
  `user_name` varchar(50) NOT NULL COMMENT '帐号名',
  `hk_type` varchar(50) default NULL COMMENT '汇款类型（银行卡划款、在上支付）',
  `hk_online_pay_no` varchar(50) default NULL COMMENT '线上支付支付编号',
  `hk_money` int(11) default NULL COMMENT '汇款金额',
  `hk_company_bank` varchar(255) default NULL COMMENT '公司银行卡帐号',
  `hk_user_bank` varchar(50) default NULL COMMENT '客户付款银行名称',
  `hk_user_name` varchar(50) default NULL COMMENT '存款人姓名',
  `hk_ip` varchar(50) default NULL COMMENT '支付电脑ip',
  `hk_time` timestamp NULL default NULL COMMENT '汇款时间',
  `hk_status` int(11) default NULL COMMENT '付款状态(1成功，0失败)',
  `create_time` timestamp NOT NULL default '0000-00-00 00:00:00' COMMENT '创建时间',
  `modify_time` timestamp NOT NULL default '0000-00-00 00:00:00' COMMENT '修改时间',
  `remark` varchar(1024) default NULL COMMENT '备注',
  `auto_update_time` datetime default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `t_web_online_huikuan` */

/*Table structure for table `t_web_os_electronic` */

DROP TABLE IF EXISTS `t_web_os_electronic`;

CREATE TABLE `t_web_os_electronic` (
  `id` int(11) NOT NULL auto_increment COMMENT '数据库主键',
  `ele_game_id` varchar(50) default NULL COMMENT '游戏ID',
  `ele_game_cnname` varchar(50) default NULL COMMENT '游戏英文名称',
  `ele_game_enname` varchar(50) default NULL COMMENT '游戏中文名称',
  `ele_game_pic` varchar(255) default NULL COMMENT '游戏图标',
  `ele_game_type1` varchar(50) default NULL COMMENT '游戏1级分类',
  `ele_game_type2` varchar(50) default NULL COMMENT '游戏2级分类',
  `remark` varchar(50) default NULL COMMENT '说明',
  `status` int(11) default NULL COMMENT '0:无效 1:有效',
  `ele_game_code` varchar(50) default NULL COMMENT '备用字段',
  `ele_game_name` varchar(50) default NULL COMMENT '备用字段',
  `ele_sort_index` int(11) default NULL COMMENT '排序索引',
  `ele_hot_num` int(11) default NULL COMMENT '热度',
  `is_water` int(11) default NULL COMMENT '是否需要返水(0:否 1:是)',
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=160 DEFAULT CHARSET=utf8;

