/*Table structure for table `t_web_page` */

DROP TABLE IF EXISTS `t_web_page`;

CREATE TABLE `t_web_page` (
  `id` int(11) NOT NULL auto_increment COMMENT '数据库主键',
  `pg_sequence` varchar(50) default NULL COMMENT '排序',
  `pg_sn` varchar(50) default NULL COMMENT '编号',
  `pg_title` varchar(255) default NULL COMMENT '页面标题',
  `pg_content` text COMMENT '页面内容',
  `pg_meta_keywords` varchar(255) default NULL COMMENT 'keywords',
  `pg_meta_description` varchar(500) default NULL COMMENT 'description',
  `status` int(11) default '0' COMMENT '启动标识(1启动，０关闭)',
  `auth` int(11) default '0' COMMENT '授权(1有，０无)',
  `create_time` timestamp NULL default NULL COMMENT '创建时间',
  `modify_time` timestamp NULL default NULL COMMENT '修改时间',
  `sys_user_name` varchar(50) default NULL,
  `remark` varchar(255) default NULL COMMENT '备注',
  `pg_type` int(11) default '1' COMMENT '页面类型（1父面、0字页）',
  `pg_ctype` int(11) default '1' COMMENT '内容类型（1文本、0链接）',
  `pg_url` varchar(255) default NULL COMMENT '内容类型为链接时的链接地址',
  `auto_update_time` datetime default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=48 DEFAULT CHARSET=utf8;

