x; background-color: rgb(17, 11, 1);\"><span style=\"color: rgb(255, 255, 255); font-family: \" microsoft=\"\" yahei=\"\" font-size:=\"\" 13px=\"\" line-height:=\"\" 30px=\"\" background-color:=\"\" rgb=\"\" 17=\"\" 11=\"\" 1=\"\">168</span></span>娱乐城相关优惠，请详见\'优惠活动<br /><br /><span style=\"color:#ffd855;\">如有任何问题，请您联系24小时在线客服！</span></span></p></div>','','',1,NULL,'2015-10-29 15:16:13','2016-09-17 07:20:13','jonny','',1,1,NULL,'2016-09-17 19:20:13'),(33,'4','question','常见问题','','1一','',1,NULL,'2015-10-29 15:16:41','2016-04-26 02:42:21','jonny','',1,1,'yxtzwt,jswt,ybwt','2016-05-17 15:36:39'),(36,'4','ybwt','一般问题','<p></p><p style=\"font-family: \'Microsoft yahei\'; padding: 0px; margin: 5px 0px; list-style-type: none; line-height: 30px; color: rgb(255, 255, 255); background-color: rgb(17, 11, 1);\"><strong>一般常见问题</strong></p><p style=\"font-family: \'Microsoft yahei\'; padding: 0px; margin: 5px 0px; list-style-type: none; line-height: 30px; color: rgb(255, 255, 255); background-color: rgb(17, 11, 1);\"><span style=\"font-size:13px;\"><span style=\"color:#ffd855;\">如何加入大發娱乐城？</span><br />您可以直接点选 &quot;立即注册&quot;，确实填写数据后，可立即登记成为<span style=\"color: rgb(255, 255, 255); font-family: &quot;Microsoft yahei&quot;; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">大發</span>娱乐城会员。</span></p><br style=\"font-family: \'Microsoft yahei\'; color: rgb(255, 255, 255); line-height: 24px; background-color: rgb(17, 11, 1);\" /><p style=\"font-family: \'Microsoft yahei\'; padding: 0px; margin: 5px 0px; list-style-type: none; line-height: 30px; color: rgb(255, 255, 255); background-color: rgb(17, 11, 1);\"><span style=\"font-size:13px;\"><span style=\"color:#ffd855;\">我可以直接在网络上存款吗？</span><br />可以，<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\"><span style=\"color: rgb(255, 255, 255); font-family: &quot;Microsoft yahei&quot;; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">大發</span></span>娱乐城提供多种在线存款选择，详情请参照 &quot;存款帮助&quot;。<br /><br /><span style=\"color:#ffd855;\">我在那里可以找到游戏的规则？</span><br />在未登入前，您可以在游戏的最外层看到&quot;游戏规则&quot;选项，清楚告诉您游戏的玩法、规则及派彩方式。 在游戏窗口中，也有&quot;规则&quot;选项，让您在享受游戏乐趣的同时，可以弹跳窗口随时提醒您游戏规则。<br /><br /><span style=\"color:#ffd855;\">我可以只试玩而不下注吗？</span><br />公司目前针对新用户开设试玩账号，您可以直接点击网站上的&quot;免费试玩&quot;注册试玩帐号。<br /><br /><span style=\"color:#ffd855;\">您们的游戏会用多少副牌？</span><br />在百家乐我们会用8副牌，其他游戏则会根据其性质有所调整。<br /><br /><span style=\"color:#ffd855;\">您们何时会洗牌?</span><br />所有纸牌游戏，当红的洗牌记号出现或游戏因线路问题中断时便会进行重新洗牌。<br /><br /><span style=\"color:#ffd855;\">我的注码的限制是多少？</span><br />从最低注单1元人民币以上即可投注，您的注码会根据您的存款有所不同，以及您挑选的游戏不同而有所区别。<br /><br /><span style=\"color:#ffd855;\">如果忘记密码怎么办？</span><br />您可点击首页忘记密码功能，填写您当初留下的邮箱，即可取回您当初设定的密码。当您无法收取邮件时，您也可以联系24小时在线客服人员咨询协助取回您的账号密码。<br /><br /><span style=\"color:#ffd855;\">如果您的姓名被注册？</span><br />当您注册时出现，姓名已注册。您可通过24小时在线客服人员协助处理。<br /><br /><span style=\"color:#ffd855;\">如果您的账号被冻结？</span><br />输入三次错误密码系统为了您的账号资金安全将自动冻结您的游戏账号，届时请您联系24小时在线客服人员协助处理。</span></p><p></p>','','',1,NULL,'2015-10-29 15:57:41','2016-09-08 22:40:10','dafa','',0,1,NULL,'2016-09-09 10:40:10'),(37,'2','jswt','相关技术问题','<span style=\"color:#ffd855;font-family: \'Microsoft yahei\';font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\">最低的硬件系统要求是什么?</span><br style=\"font-family: \'Microsoft yahei\'; color: rgb(255, 255, 255);font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\" /><br style=\"font-family: \'Microsoft yahei\'; color: rgb(255, 255, 255);font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\" /><span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\';font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\">1.任何可以接上互联网的计算机。</span><br style=\"font-family: \'Microsoft yahei\'; color: rgb(255, 255, 255);font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\" /><span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\';font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\">2.SVGA显示适配器–最少要1204x768像素256色彩以上。</span><br style=\"font-family: \'Microsoft yahei\'; color: rgb(255, 255, 255);font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\" /><span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\';font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\">3.区域宽带。</span><br style=\"font-family: \'Microsoft yahei\'; color: rgb(255, 255, 255);font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\" /><span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\';font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\">4.Windows , Mac OS X , Linux作业系统。</span><br style=\"font-family: \'Microsoft yahei\'; color: rgb(255, 255, 255);font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\" /><span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\';font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\">5.Internet Explorer浏览器v7.5 或以上 (版本8.0 或以上更好)，Mozilla Firefox (浏览器v3.0 或以上)，Opera (浏览器v8.0 或以上)，Chrome(浏览器v6.0 或以上)，Safari (浏览器v4.0 或以上)</span><br style=\"font-family: \'Microsoft yahei\'; color: rgb(255, 255, 255);font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\" /><span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\';font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\">6.要浏览在线娱乐城，你可以在 Macromedia网站下载Macromedia Flash Player浏览器附加程序(8.0或以上版本)。</span>','','',1,NULL,'2015-10-29 16:49:18','2016-09-17 07:19:17','jonny','',0,1,NULL,'2016-09-17 19:19:17'),(38,'1','yxtzwt','游戏投注问题','<span style=\"color:#ffd855;font-family: \'Microsoft yahei\';font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168娱乐城有哪些游戏？</span><br style=\"font-family: \'Microsoft yahei\'; color: rgb(255, 255, 255);font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\" /><s