or:#ffd855;\">代理申请：</span></strong><br /><br />请点击<span style=\"color:#ffd855;\">【代理注册】</span>线上提出申请或联系客服，并确实填写各项资料(一定要确实留下有效电子邮箱）。我们会评估审核联盟申请讯息，3日内由专员与您联系开通，并提供您的注册帐号、密码及推广连结。</span></p><p style=\"font-family: \'Microsoft yahei\'; padding: 0px; margin: 5px 0px; list-style-type: none; line-height: 30px; color: rgb(255, 255, 255); background-color: rgb(17, 11, 1);\"><strong><span style=\"font-size:13px;color:#ffd855;\">代理佣金方案 ：</span></strong></p><span style=\"color:#FFF;font-family: \'Microsoft yahei\'; color: rgb(255, 255, 255); line-height: 24px; background-color: rgb(17, 11, 1);\"></span><br /><ul style=\"font-family: \'Microsoft yahei\'; margin: 0px; padding: 0px; border: 0px; list-style-type: none; color: rgb(255, 255, 255); line-height: 24px; background-color: rgb(17, 11, 1);\"><li style=\"margin: 0px; padding: 0px; border: 0px; list-style-type: none;\"><span style=\"color:#ffd855;\"><span style=\"font-family: STHeiti, \'Microsoft YaHei\', 微软雅黑, SimSun, 宋体, arial; margin: 0px; padding: 0px; border: 0px;\">注：请谨记任何使用不诚实方法骗取佣金将会永久冻结账户，佣金一律不发还！168保留上述条例之最终更改权！</span></span></li></ul><p style=\"font-family: \'Microsoft yahei\'; padding: 0px; margin: 5px 0px; list-style-type: none; line-height: 30px; color: rgb(255, 255, 255); background-color: rgb(17, 11, 1);\"><span style=\"font-size:13px;\"><span style=\"color:#ffd855;\"><strong>回馈/佣金计算:</strong></span><br /><img src=\"data:image/png;base64,\" alt=\"\" /><br />◆请注意：<br /><br />视讯、球类、机率等项目，以报表中【派彩】字段，扣除相应费用后，依照上表门坎 X 佣金百分比。彩票项目以报表中【实际投注】字段，扣除相应费用后 X 0.1% 佣金百分比。<br /><br />◆当月联盟体系【派彩/投注量/总额公点金额】，依照：视讯、球类、机率、彩票等顺序扣除相应费用。<br /><br />◆相应费用包括: 为会员优惠、存/取款相应费用(请留意：会员重复出款￥手续费/未达100%投注出款的手续费由会员吸收，不纳入计算)。<br /><br />◆【当月最低有效会员】定义为，在月结区间内进行过最少500RMB有效下注的会员，如联盟体系当月未达【当月最低有效会员】最低门坎3人，则该月无法领取佣金回馈。联盟体系当月营利达到标准，而【当月最低有效会员】人数未达相应最低门坎，则该月佣金比例依照【当月最低有效会员】人数所达门坎相应的百分比进行退佣。<br />◆例：体系当月营利为￥50001，而当月有效会员人数为3人，联盟虽达到营利为￥50001，却未达到有效会员5人以上，故依照联盟有效会员人数3人的门坎的退佣比例核算。</span></p><table cellspacing=\"1\" cellpadding=\"1\" border=\"5\" id=\"table4\" style=\"font-family: STHeiti, \'Microsoft YaHei\', 微软雅黑, SimSun, 宋体, arial; color: rgb(255, 255, 255); font-size: 12px; widows: auto; border-collapse: collapse; width: 300px; border-width: 1px; background-color: rgb(17, 11, 1);\"><tbody style=\"font-family: \'Microsoft yahei\';\"><tr><td style=\"font-family: \'Microsoft yahei\'; text-align: center; margin: 0px; padding: 0px;\"><span style=\"font-weight: bolder;\">视讯</span></td><td style=\"font-family: \'Microsoft yahei\'; text-align: center; margin: 0px; padding: 0px;\"><span style=\"font-weight: bolder;\">BB体育</span></td><td style=\"font-family: \'Microsoft yahei\'; text-align: center; margin: 0px; padding: 0px;\"><span style=\"font-weight: bolder;\">机率</span></td><td style=\"font-family: \'Microsoft yahei\'; text-align: center; margin: 0px; padding: 0px;\"><span style=\"font-weight: bolder;\">彩票</span></td><td style=\"font-family: \'Microsoft yahei\'; text-align: center; margin: 0px; padding: 0px;\"><span style=\"font-weight: bolder;\">BB彩票</span></td></tr><tr><td style=\"font-family: \'Microsoft yahei\'; text-align: center; margin: 0px; padding: 0px;\"><span style=\"color:#FFF;\">30%</span></td><td style=\"font-family: \'Microsoft yahei\'; text-align: center; margin: 0px; padding: 0px;\">30%</td><td style=\"font-family: \'Microsoft yahei\'; text-align: center; margin: 0px; padding: 0px;\">30%</td><td style=\"font-family: \'Microsoft yahei\'; text-align: center; margin: 0px; padding: 0px;\">0.1%</td><td style=\"font-family: \'Microsoft yahei\'; text-align: center; margin: 0px; padding: 0px;\">0.1%</td></tr></tbody></table><p style=\"font-family: \'Microsoft yahei\'; padding: 0px; margin: 5px 0px; list-style-type: none; line-height: 30px; color: rgb(255, 255, 255); background-color: rgb(17, 11, 1);\"><span style=\"font-size:13px;\">◆例： 联盟体系当月最低有效会员达12人，当月派彩：视讯￥300000，球类￥-120000，机率￥20000，彩票有效投注￥800000。如联盟体系当月相应费用统计为￥14000，则佣金计算方式为：<br /><br /><strong><span style=\"color:#ffd855;\">当月佣金计算：</span></strong><br /><br />(总派彩金额￥200000，退佣百分比为30%)<br /><br />(￥800000 彩票投注 x 0.1% 返点百分比) - ￥14000 相应费用= -13200<br /><br />(-13200+￥200000派彩)*30%=￥56040佣金<br /><br />*佣金百分比，依未扣除相应费用前之&quot;各项派彩&quot;金额为准。<br /><br />*假若本月可获得佣金为负数﹐ 派彩及费用将会带到下个月继续累计至可获得佣金为正数即可领取。<br /><br /><span style=\"color:#ffd855;\"><strong>回馈/佣金支付：</strong></span><br />联盟佣金计算，结算区间为本月第一个礼拜一至下月第一个礼拜一前的周日，将会员盈利，以联盟方案分红公式计算，扣除联盟体系会员相应的优惠、行政费用后，佣金由代理客服于每个月的第一个礼拜四开始与代理核对佣金后，在每个月的第一个礼拜日以前将佣金直接汇入代理联盟指定之银行帐号。每月代理联盟业绩于结算后归零重新开始。</span></p><p style=\"font-family: \'Microsoft yahei\'; padding: 0px; margin: 5px 0px; list-style-type: none; line-height: 30px; background-color: rgb(17, 11, 1);\"><span style=\"color: rgb(255, 255, 255); font-size: 13px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><strong><span style=\"font-size:16px;color:#ff0000;\">代理专员QQ:3260394705</span></strong></p>','','',1,NULL,'2015-10-29 16:54:23','2016-09-23 10:05:58','168','',0,1,NULL,'2016-09-18 12:40:09'),(40,'3','lmxy','联盟协议','<span style=\"color:#ffd855;font-family: \'Microsoft yahei\';font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\">一、168娱乐城对代理联盟的权利与义务</span><br style=\"font-family: \'Microsoft yahei\'; color: rgb(255, 255, 255);font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\" /><br style=\"font-family: \'Microsoft yahei\'; color: rgb(255, 255, 255);font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\" /><span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\';font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\">1.168娱乐城的客服部会登记联盟的会员并会观察他们的投注状况。联盟及会员必须同意并遵守<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城的会员条例，政策及操作程式。<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城保留拒绝或冻结联盟/会员帐户权利</span><br style=\"font-family: \'Microsoft yahei\'; color: rgb(255, 255, 255);font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\" /><span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\';font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\">2.代理联盟可随时登入介面观察旗下会员的下注状况及会员在网站的活动概况。<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城的客服部会根据代理联盟旗下的会员计算所得的佣金。</span><br style=\"font-family: \'Microsoft yahei\'; color: rgb(255, 255, 255);font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\" /><span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\';font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\">3.<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城保留可以修改合约书上的任何条例，包括: 现有的佣金范围、佣金计划、付款程式、及参考计划条例的权力，<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城会以电邮、网站公告等方法通知代理联盟。 代理联盟对于所做的修改有异议，代理联盟可选择终止合约，或洽客服人员反映意见。 如修改后代理联盟无任何异议，便视作默认合约修改，代理联盟必须遵守更改后的相关规定。</span><br style=\"font-family: \'Microsoft yahei\'; color: rgb(255, 255, 255);font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\" /><br style=\"font-family: \'Microsoft yahei\'; color: rgb(255, 255, 255);font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\" /><span style=\"color:#ffd855;font-family: \'Microsoft yahei\';font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\">二、代理联盟对澳门168娱乐城的权力及义务</span><br style=\"font-family: \'Microsoft yahei\'; color: rgb(255, 255, 255);font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\" /><br style=\"font-family: \'Microsoft yahei\'; color: rgb(255, 255, 255);font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\" /><span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\';font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\">1.代理联盟应尽其所能，广泛地宣传、销售及推广<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城，使代理本身及<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城的利润最大化。代理联盟可在不违反法律下，以正面形象宣传、销售及推广<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城，并有责任义务告知旗下会员所有<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城的相关优惠条件及产品。</span><br style=\"font-family: \'Microsoft yahei\'; color: rgb(255, 255, 255);font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\" /><span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\';font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\">2.代理联盟选择的<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城推广手法若需付费，则代理应承担该费用。</span><br style=\"font-family: \'Microsoft yahei\'; color: rgb(255, 255, 255);font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\" /><span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\';font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\">3.任何<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城相关资讯包括: 标志、报表、游戏画面、图样、文案等，代理联盟不得私自复制、公开、分发有关材料，<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城保留法律追诉权。 如代理在做业务推广有相关需要，请随时洽<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城。</span><br style=\"font-family: \'Microsoft yahei\'; color: rgb(255, 255, 255);font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\" /><br style=\"font-family: \'Microsoft yahei\'; color: rgb(255, 255, 255);font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\" /><span style=\"color:#ffd855;font-family: \'Microsoft yahei\';font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\">三、规则条款</span><br style=\"font-family: \'Microsoft yahei\'; color: rgb(255, 255, 255);font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\" /><br style=\"font-family: \'Microsoft yahei\'; color: rgb(255, 255, 255);font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\" /><span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\';font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\">1.各阶层代理联盟不可在未经<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城许可情况下开设双/多个的代理帐号，也不可从<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城帐户或相关人士赚取佣金。请谨记任何阶层代理不能用代理帐户下注，<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城有权终止并封存帐号及所有在游戏中赚取的佣金。</span><br style=\"font-family: \'Microsoft yahei\'; color: rgb(255, 255, 255);font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\" /><span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\';font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\">2.为确保所有<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城会员账号隐私与权益，<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城不会提供任何会员密码，或会员个人资料。各阶层代理联盟亦不得以任何方式取得会员资料，或任意登入下层会员账号，如发现代理联盟有侵害<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城会员隐私行为，<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城有权取消代理联盟红利，并取消代理联盟账号。</span><br style=\"font-family: \'Microsoft yahei\'; color: rgb(255, 255, 255);font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\" /><span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\';font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\">3.代理联盟旗下的会员不得开设多于一个的帐户。<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城有权要求会员提供有效的身份证明以验证会员的身份，并保留以IP判定是否重复会员的权利。如违反上述事项，<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城有权终止玩家进行游戏并封存帐号及所有于游戏中赚取的佣金</span><br style=\"font-family: \'Microsoft yahei\'; color: rgb(255, 255, 255);font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\" /><span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\';font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\">4.代理联盟不可为自己或其他联盟下的有效投注会员,只能是公司直属下的有效投注会员, 代理每月需有５个下线有效投注会员（每月至少上线3次进行正常投注），如有违反联盟协议<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城有权终止并封存帐号及所有在游戏中赚取的佣金。</span><br style=\"font-family: \'Microsoft yahei\'; color: rgb(255, 255, 255);font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\" /><span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\';font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\">5.如代理联盟旗下的会员因为违反条例而被禁止享用<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城的游戏，或<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城退回存款给会员，<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城将不会分配相应的佣金给代理联盟。如代理联盟旗下会员存款用的信用卡、银行资料须经审核，<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城保留相关佣金直至审核完成。</span><br style=\"font-family: \'Microsoft yahei\'; color: rgb(255, 255, 255);font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\" /><span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\';font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\">6.合约内的条件会以<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城通知接受代理联盟加入后开始执行。<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城及代理联盟可随时终止此合约，在任何情况下，代理联盟如果想终止合约，都必须以书面/电邮方式提早于七日内通知<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城。 代理联盟的表现会3个月审核一次，如代理联盟已不是现有的合作成员则本合约书可以在任何时间终止。如合作伙伴违反合约条例，<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城有权立即终止合约。</span><br style=\"font-family: \'Microsoft yahei\'; color: rgb(255, 255, 255);font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\" /><span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\';font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\">7.在没有<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城许可下，代理联盟不能透露及授权<span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\'; font-size: 13px; line-height: 30px; background-color: rgb(17, 11, 1);\">168</span>娱乐城相关密资料，包括代理联盟所获得的回馈、佣金报表、计算等;代理联盟有义务在合约终止后仍执行机密档及资料的保密。</span><br style=\"font-family: \'Microsoft yahei\'; color: rgb(255, 255, 255);font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\" /><p><span style=\"color: rgb(255, 255, 255); font-family: \'Microsoft yahei\';font-size:13px; line-height: 30px; background-color: rgb(17, 11, 1);\">8.在合约终止后，代理联盟及168娱乐城将不须要履行双方的权利及义务。终止合约并不会解除代理联盟于终止合约前应履行的义务。</span></p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<span style=\"font-family:Microsoft yahei;\"><strong><span style=\"font-size:16px;color:#ff0000;\">代理专员QQ:3260394705</span></strong></span></p>','','',1,NULL,'2015-10-29 16:55:06','2016-09-18 00:39:16','jonny','',0,1,NULL,'2016-09-18 12:39:16'),(41,'2','dldr','代理登入','','','',1,NULL,'2015-10-29 16:55:45','2015-10-29 16:55:45','admin','',0,1,NULL,'2016-05-17 15:36:39'),(42,'50','m_duty','博彩责任','<div style=\"text-align: center;\"><strong>博彩责任</strong></div><div style=\"text-align: left;\">概述：<br /></div><div style=\"text-align: left;\">168娱乐城希望您享受博彩过程。我们知道必须对博彩秉持负责任的态度，因此制定了多项措施来促进和确保可靠、可信的博彩。如果您认为您或其他人有博彩问题，请先查看下文所述的严重博彩引发的问题：<br /></div><div style=\"text-align: left;\"><br /></div><div style=\"text-align: left;\">取款限制次数：<br /></div><div style=\"text-align: left;\">我们理解，某些客户希望能对一天内取款次数多一些，但考虑到年末将至银行方面对资金流动有做限制，因些希望客户理解下我们的难处。取款方面我们目前还是控制2次/天。</div><div style=\"text-align: left;\">未满博彩年龄：</div><div style=\"text-align: left;\">未满 18 岁的人士在168娱乐城开设账户或投注属非法行为。我们对此将极其严肃地履行自己的责任，并对选择儿童也可使用的付款方法的客户展开严格的年龄核实。我们还保留在请求客户提供文件期间暂时冻结账户的权利。<br /></div>','','',1,NULL,'2015-12-25 01:45:30','2016-09-18 00:41:29','jonny','',3,1,NULL,'2016-09-18 12:41:29'),(43,'49','m_fair','公平与公正','<div style=\"text-align: center;\"><strong>公平与公正</strong></div><div style=\"text-align: left;\">所有游戏数据结果是通过&quot;随机数码器&quot;或&quot;RNG&quot;采用复杂的数学算法所随机产生的结果，且无法受人为因素影响。RNG随机数码器已通过国际公认的测试机构 Technical Systems Testing (TST) 和 eCOGRA 严格检测，并且遵守所有有关政策。<br /></div><div style=\"text-align: left;\"><br /></div><address style=\"text-align: left;\"><span style=\"font-style: normal;\">此外，作为168娱乐城的品牌，我们对客户的投注以及盈利一直遵守着诚信正直的承诺。 为了显现透明度，所有在168娱乐城的游戏投注项目经定期给一个独立的公司审计以提供所有游戏的百分比派息（RTP％）。</span></address><address style=\"text-align: left;\"><span style=\"font-style: normal;\"><br /></span></address><address style=\"text-align: left;\"><span style=\"font-style: normal;\">常见问题168娱乐城的游戏是由谁提供的？我们的游戏软件提供商是Asia Gaming, Microgaming, Playtech, 以及 Open Bet Platform等等.</span><br /></address><address style=\"text-align: left;\"><span style=\"font-style: normal;\"><br /></span></address><address style=\"text-align: left;\"><span style=\"font-style: normal;\">游戏是如何进行公证的检测？除了真人娱乐场的桌牌游戏外，其它的游戏数据结果是通过&quot;随机数码器&quot;或&quot;RNG&quot;采用复杂的数学算法所随机产生的结果。&quot;随机数码器&quot;或&quot;RNG&quot;是由各提供商通过严格测试以符合并达到专业标准。<br /></span></address><address style=\"text-align: left;\"><span style=\"font-style: normal;\"><br /></span></address><address style=\"text-align: left;\"><span style=\"font-style: normal;\">我可以在哪里索取RNG证书的副本？您可以发邮件至1368001@gmail.com以索取最新的RNG证书。<br /></span></address>','','',1,NULL,'2015-12-25 02:24:18','2016-09-17 07:17:21','jonny','',3,1,NULL,'2016-09-17 19:17:21'),(44,'48','m_rule','规则与条款','<div style=\"text-align: center;\"><strong>规则与条款</strong></div><div style=\"text-align: left;\"><strong>涉及和调整任何特定赛事、游戏软件、现金回赠、注册优惠、与我们提供的任何产品和服务相关的其他推广或邀请赛的其他规则与条款统称为&quot;规则与条款&quot;.在一般使用规则与条款中，除非另行注明，否则&quot;投注规则&quot;应当包括:<br /></strong></div><div style=\"text-align: left;\"><strong><br /></strong></div><div style=\"text-align: left;\"><strong>体育投注规则<br /></strong></div><div style=\"text-align: left;\"><strong>2.2 规则与条款规定了168娱乐城与客户(&quot;您&quot;)之间存在的条款，适用于客户通过我们网站上的聊天服务(&quot;聊天&quot;):浏览我们通过网站（主要URL链接:www.1368001.com</strong><span style=\"font-weight: bold;\">以及我们拥有的该网站的任何设备特有版本比如[www.1368001.com]或其他相关移动应用软件(&quot;网站&quot;)提供的所有产品和服务(&quot;服务&quot;).</span></div><div style=\"text-align: left;\"><span style=\"font-weight: bold;\">2.3 若您与<span style=\"font-weight: bold;\"><span style=\"font-weight: bold;\"><span style=\"font-weight: bold;\">168</span>娱乐城</span></span>签订的合同中包含的规则与条款的各个部分之间出现具体冲突或不一致，则一般使用规则与条款应当优先适用。<br /></span></div><div style=\"text-align: left;\"><span style=\"font-weight: bold;\">2.4 本规则与条款构成您与<span style=\"font-weight: bold;\"><span style=\"font-weight: bold;\"><span style=\"font-weight: bold;\">大發</span>娱乐城</span></span>之间具有法律约束力的协议。使用和/或浏览168<span style=\"font-weight: bold;\"><span style=\"font-weight: bold;\">娱乐城</span></span>网站或我们拥有的任何其他网站或应用软件的任何部分（包括子域）或通过网站注册<span style=\"font-weight: bold;\"><span style=\"font-weight: bold;\"><span style=\"font-weight: bold;\">168</span>娱乐城</span></span>账户即表示您同意受规则与条款的约束，它还相应地表示您同意使用电子通信方式签订合同以及放弃要求手写签名的任何相关权利或要求，只要任何适用的法律允许。<br /></span></div>','','',1,NULL,'2015-12-25 02:28:40','2016-09-17 07:16:48','jonny','',3,1,NULL,'2016-09-17 19:16:48'),(45