用卡号码，以及共享计算机环境\r\n																			(例如:网吧、其他公共用计算机等)只能够拥有一个会员账号，各项优惠只适用于每位客户在威尼斯人线上娱乐唯一的账户。\r\n																		</div>\r\n																		<div class=\"kfxyclass\">\r\n																			7.\r\n																			168线上娱乐是提供互联网投注服务的机构。请会员在注册前参考当地政府的法律，在博彩不被允许的地区，如有会员在168线上娱乐注册、下注，为会员个人行为，168线上娱乐不负责、承担任何相关责任。\r\n																		</div>\r\n																		<div class=\"kfxyclass\">\r\n																			8.\r\n																			无论是个人或是团体，如有任何威胁、滥用168线上娱乐优惠的行为，168线上娱乐保留杈利取消、收回由优惠产生的红利，并保留权利追讨最高50%手续费。\r\n																		</div>\r\n																		<div class=\"kfxyclass\">\r\n																			9.\r\n																			所有168线上娱乐的优惠是特别为玩家而设，在玩家注册信息有争议时，为确保双方利益、杜绝身份盗用行为，168线上娱乐保留权利要求客户向我们提供充足有效的文件，\r\n																			并以各种方式辨别客户是否符合资格享有我们的任何优惠。\r\n																		</div>\r\n																		<div class=\"kfxyclass\">\r\n																			10. 客户一经注册开户，将被视为接受所有颁布在168线上娱乐网站上的规则与条例。\r\n																		</div>\r\n																		<p style=\"color: red\">\r\n																			本公司是使用168所提供的在线娱乐软件，若发现您在同系统的娱乐城上开设多个会员账户，并进行套利下注；本公司有权取消您的会员账号并将所有下注营利取消！\r\n																		</p>\r\n',1,NULL,'2015-07-15 15:56:55','2016-09-17 07:07:46','成功登录弹出信息','jonny','2016-09-17 19:07:46'),(31,'msg011','忘记密码提醒','请持帐号、姓名及手机号码联系我们24小时在线客服重置密码，谢谢！',1,NULL,'2015-07-15 16:17:58','2015-07-31 14:53:12','忘记密码','admin','2016-05-17 15:54:49'),(33,'msg012','登录提醒信息','欢迎您登录168娱乐城',0,0,NULL,'2016-09-17 07:07:09','','jonny','2016-09-17 19:07:09');

