/*Table structure for table `t_web_resource` */

DROP TABLE IF EXISTS `t_web_resource`;

CREATE TABLE `t_web_resource` (
  `rs_name` varchar(50) NOT NULL COMMENT '标识-主键',
  `rs_title` varchar(50) default NULL COMMENT '标题',
  `rs_url` varchar(255) default NULL COMMENT '资源地址',
  `status` int(11) default '0' COMMENT '启动1或关闭0',
