/*Table structure for table `t_web_sun_time` */

DROP TABLE IF EXISTS `t_web_sun_time`;

CREATE TABLE `t_web_sun_time` (
  `id` int(11) NOT NULL auto_increment COMMENT '数据库主键',
  `begin_time` timestamp NULL default NULL COMMENT '开始本次采集时间',
  `end_time` timestamp NULL default NULL COMMENT '结束本次采集时间',
  `bet_sn` varchar(50) default NULL COMMENT '本次最大投注编号',
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

