/*Table structure for table `t_web_switch` */

DROP TABLE IF EXISTS `t_web_switch`;

CREATE TABLE `t_web_switch` (
  `swt_name` varchar(50) NOT NULL COMMENT '标识-主键',
  `swt_title` varchar(50) default NULL COMMENT '标题',
  `status` int(11) default '0' COMMENT '启动1或关闭0（呈现）',
  `create_time` datetime default NULL COMMENT '创建时间',
  `modify_time` datetime default NULL COMMENT '修改时间',
  `remark` varchar(255) default NULL COMMENT '备注',
  `sys_user_name` varchar(50) default NULL COMMENT '操作员',
  `needed` int(11) default NULL COMMENT '是否必填',
  `auto_update_time` datetime default NULL,
  PRIMARY KEY  (`swt_name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

