/*Table structure for table `t_web_user` */

DROP TABLE IF EXISTS `t_web_user`;

CREATE TABLE `t_web_user` (
  `id` int(11) NOT NULL auto_increment,
  `user_flag` varchar(50) NOT NULL COMMENT '用户标识（哪个网站的）',
  `user_name` varchar(50) NOT NULL,
  `user_byname` varchar(50) default NULL,
  `user_password` varchar(50) NOT NULL,
  `user_status` int(11) default NULL,
  `user_type` int(11) default NULL,
  `user_money` double default NULL,
  `user_remark` varchar(255) default NULL,
  `user_last_login_time` timestamp NULL default NULL,
  `user_last_login_ip` varchar(50) default NULL,
  `user_login_times` int(11) default NULL,
  `user_real_name` varchar(50) default NULL,
  `user_bank_type` varchar(50) default NULL,
  `user_bank_card` varchar(50) default NULL,
  `user_bank_address` varchar(255) default NULL,
  `user_withdraw_password` varchar(50) default NULL,
  `user_mobile` varchar(50) default NULL,
  `user_qq` varchar(50) default NULL,
  `create_time` timestamp NULL default NULL,
  `modify_time` timestamp NULL default NULL,
  `sys_user_name` varchar(50) default NULL COMMENT '操作人',
  `user_ps_times` int(11) default NULL COMMENT '密码次数（最多10次）',
  `user_agent` varchar(50) default NULL COMMENT '代理线帐号',
  `mine_agent` varchar(50) default NULL COMMENT '代理号',
  `user_mail` varchar(255) default NULL COMMENT '邮箱地址',
