/*Table structure for table `t_web_user_type` */

DROP TABLE IF EXISTS `t_web_user_type`;

CREATE TABLE `t_web_user_type` (
  `id` int(11) NOT NULL auto_increment COMMENT '数据库主键',
  `type_name` varchar(50) NOT NULL COMMENT '类型名称',
  `type_status` int(11) default NULL COMMENT '启动标识（1启动、0关闭）',
  `remark` varchar(255) default NULL COMMENT '备注',
  `type_default` int(11) default NULL COMMENT '是否为默认会员',
  `type_pic` mediumblob COMMENT '会员等级图片',
  `type_level` varchar(20) default NULL COMMENT '会员等级名称',
  `msg_content` text COMMENT '会员中心弹框内容',
  `content_status` int(2) default NULL COMMENT '控制是否弹框(0:关闭 1:启动)',
  `auto_update_time` datetime default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1004 DEFAULT CHARSET=utf8;

