/*Table structure for table `t_web_user_withdraw` */

DROP TABLE IF EXISTS `t_web_user_withdraw`;

CREATE TABLE `t_web_user_withdraw` (
  `id` int(11) NOT NULL auto_increment COMMENT '数据库主健',
  `user_order` varchar(50) default NULL COMMENT '编号',
  `user_name` varchar(50) NOT NULL COMMENT '帐号名',
  `user_real_name` varchar(50) default NULL COMMENT '取款姓名',
  `user_withdraw_money` double default NULL COMMENT '取款金额',
  `user_bank_info` varchar(255) default NULL COMMENT '银行卡信息',
  `status` int(11) default NULL COMMENT '状态（1已出款，0未出款）',
  `check_status` int(11) default NULL COMMENT '审核状态：1审核通过，2审核不通过',
  `check_time` timestamp NULL default NULL COMMENT '审核时间',
  `withdraw_type` int(11) default NULL COMMENT '取款类型（11会员取款、12系统扣款）',
  `check_sys_user_name` varchar(50) default NULL COMMENT '审核人',
  `create_time` timestamp NULL default NULL COMMENT '创建时间',
  `modify_time` timestamp NULL default NULL COMMENT '修改时间',
  `remark` varchar(255) default NULL COMMENT '备注',
  `gmt_4_time` timestamp NULL default NULL,
  `total_times` int(11) default NULL COMMENT '总次数',
  `day_times` int(11) default NULL COMMENT '当天次数',
  `user_procedure` double default NULL COMMENT '手续费用',
  `user_administration` double default NULL COMMENT '行政费用',
  `user_cost` int(11) default NULL COMMENT '扣手续费用（1有，0无）',
  `user_withdraw_real_money` double default NULL COMMENT '真正出款的钱',
  `auto_update_time` datetime default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=191 DEFAULT CHARSET=utf8;

/*Data for the table `t_web_user_withdraw` */

insert  into `t_web_user_withdraw`(`id`,`user_order`,`user_name`,`user_real_name`,`user_withdraw_money`,`user_bank_info`,`status`,`check_status`,`check_time`,`withdraw_type`,`check_sys_user_name`,`create_time`,`modify_time`,`remark`,`gmt_4_time`,`total_times`,`day_times`,`user_procedure`,`user_administration`,`user_cost`,`user_withdraw_real_money`,`auto_update_time`) values (190,'1609230639260561','ccww89','陈宝',100,'中国银行|62285675645635|hjfg',1,1,'2016-09-23 06:40:24',11,'168','2016-09-23 06:39:26','2016-09-23 06:40:24','出口','2016-09-23 06:39:26',1,1,0,0,0,0,'2016-09-23 18:40:24');

