/* Procedure structure for procedure `account_sync` */

/*!50003 DROP PROCEDURE IF EXISTS  `account_sync` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `account_sync`(userName VARCHAR(20),proType VARCHAR(20),optType VARCHAR(20),userMoney DECIMAL(20,3),orderNo VARCHAR(40),optName VARCHAR(20),remark VARCHAR(200),OUT error_code INT)
BEGIN
	DECLARE userAgent VARCHAR(32);
	DECLARE total INT DEFAULT 0;
	DECLARE gt4time DATETIME;
	DECLARE beforeMoney NUMERIC(20,6) DEFAULT 0;
	DECLARE afterMoney NUMERIC(20,6) DEFAULT 0;
	SELECT COUNT(*) INTO total FROM t_web_user WHERE user_name=userName;
	SELECT DATE_SUB(SYSDATE(),INTERVAL 12 HOUR) INTO gt4time;
	SET error_code=-1;
	IF(total>0) THEN
	    SELECT  user_money,user_agent INTO beforeMoney,userAgent FROM t_web_user WHERE user_name=userName;	    
	    UPDATE t_web_user SET user_money=ROUND(user_money+userMoney,3) WHERE user_name=userName AND IF(user_money+userMoney>=0,TRUE,FALSE);
            IF ROW_COUNT()>0 THEN
		SELECT ROUND(user_money,3) INTO afterMoney FROM t_web_user WHERE user_name=userName;
		INSERT INTO t_web_account(user_name,act_opt_money,act_result_money,act_pro_type,act_opt_type,act_order,sys_user_name,STATUS,remark,create_time,modify_time,user_agent,gmt_4_time)
		VALUES(userName,userMoney,afterMoney,proType,optType,orderNo,optName,0,remark,SYSDATE(),SYSDATE(),userAgent,gt4time);
		SET error_code=1;	
            END IF;		
	    
	END IF;	
    END */$$
DELIMITER ;

